import React from "react";
import "./StartModal.css";

const StartModal = (props) => {
  const ClickHandlingFunction = () => {
    props.onClick(true);
  };

  return (
    <div>
      <div className="backdrop" onClick={ClickHandlingFunction} />
      <div className="modal">
        <header className="header">
          <h2>{props.title}</h2>
        </header>
        <div className="content">
          <p>{props.message}</p>
          <div>
            <label>Please Enter Your Name here:</label>
          </div>
          <div>
            <input type="text" />
          </div>
        </div>
        <footer className="actions">
          <button className="button_" onClick={ClickHandlingFunction}>Okay</button>
        </footer>
      </div>
    </div>
  );
};

export default StartModal;
